  <style>
    /* Styling for the container */
    #rifat {
      width: 100%;
      height: 100vh;
      position: fixed;
      top: 0;
      left: 0;
      background-color: rgba(0, 0, 0, 0.8);
      display: flex;
      justify-content: center;
      align-items: center;
      z-index: 9999;
      display: none; /* Initially hidden */
    }

    /* Styling for the embedded ad */
    #aswift_1 {
      width: 100%;
      height: 100%;
      border: none;
    }

    /* Styling for the close button */
    .close-btn {
      position: absolute;
      top: 10px;
      right: 10px;
      cursor: pointer;
      color: white;
      font-size: 24px;
    }
  </style>

  <!-- Add Font Awesome CSS (you can get this from their website) -->

</head>
<body>
  <!-- The interstitial ad container -->
  <div id="rifat">
    <span class="close-btn" onclick="closeInterstitial"><i class="fas fa-times"></i></span>
    <iframe id="aswift_1" name="aswift_1"></iframe>
  </div>

  <!-- Your page content goes here -->

  <script>
    // Function to show the interstitial ad
    function showInterstitial() {
      var adContainer = document.getElementById('rifat');
      adContainer.style.display = 'block';

      var adIframe = document.getElementById('aswift_1');
      adIframe.src = 'https://www.rotate4all.com/ptp/promote-278959';
    }

    // Function to close the interstitial ad
    function closeInterstitial() {
      var adContainer = document.getElementById('rifat');
      adContainer.style.display = 'none';

      var adIframe = document.getElementById('aswift_1');
      adIframe.src = ''; // Unload the ad iframe
    }

    // Automatically show the interstitial ad after the page loads
    window.onload = function() {
      showInterstitial();
    };
  </script>

</body>
